Creates a new timer.

The [callback] callback is invoked after the given [duration].
A negative duration is treated similar to a duration of 0.

If the [duration] is statically known to be 0, consider using [run].

Frequently the [duration] is either a constant or computed as in the
following example (taking advantage of the multiplication operator of
the Duration class):

    const TIMEOUT = const Duration(seconds: 3);
    const ms = const Duration(milliseconds: 1);

    startTimeout([int milliseconds]) {
      var duration = milliseconds == null ? TIMEOUT : ms * milliseconds;
      return new Timer(duration, handleTimeout);
    }

Note: If Dart code using Timer is compiled to JavaScript, the finest
granularity available in the browser is 4 milliseconds.

Base class for transformers that modifies stream events.

A [StreamEventTransformer] transforms incoming Stream
events of one kind into outgoing events of (possibly) another kind.

Subscribing on the stream returned by [bind] is the same as subscribing on
the source stream, except that events are passed through the [transformer]
before being emitted. The transformer may generate any number and
types of events for each incoming event. Pauses on the returned
subscription are forwarded to this stream.

An example that duplicates all data events:

    class DoubleTransformer<T> extends StreamEventTransformerBase<T, T> {
      void handleData(T data, EventSink<T> sink) {
        sink.add(value);
        sink.add(value);
      }
    }
    someTypeStream.transform(new DoubleTransformer<Type>());

The default implementations of the "handle" methods forward
the events unmodified. If using the default [handleData] the generic type [T]
needs to be assignable to [S].

Create a [StreamTransformer] that delegates events to the given functions.

This is actually a [StreamEventTransformer] where the event handling is
performed by the function arguments.
If an argument is omitted, it acts as the corresponding default method from
[StreamEventTransformer].

Example use:

    stringStream.transform(new StreamTransformer<String, String>(
        handleData: (Strung value, EventSink<String> sink) {
          sink.add(value);
          sink.add(value);  // Duplicate the incoming events.
        }));

The [WebSocketTransformer] provides the ability to upgrade a
[HttpRequest] to a [WebSocket] connection. It supports both
upgrading a single [HttpRequest] and upgrading a stream of
[HttpRequest]s.

To upgrade a single [HttpRequest] use the static [upgrade] method.

    HttpServer server;
    server.listen((request) {
      if (...) {
        WebSocketTransformer.upgrade(request).then((websocket) {
          ...
        });
      } else {
        // Do normal HTTP request processing.
      }
    });

To transform a stream of [HttpRequest] events as it implements a
stream transformer that transforms a stream of HttpRequest into a
stream of WebSockets by upgrading each HttpRequest from the HTTP or
HTTPS server, to the WebSocket protocol.

    server.transform(new WebSocketTransformer()).listen((webSocket) => ...);

This transformer strives to implement web sockets as specified by RFC6455.

Gets the segments of a Path. The segments are just the result of
splitting the path on any '/' characters, except that a '/' at the
beginning does not create an empty segment before it, and a '/' at
the end does not create an empty segment after it.

    new Path('/a/b/c/d').segments() == ['a', 'b', 'c', d'];
    new Path(' foo bar //../') == [' foo bar ', '', '..'];

[:HttpMultipartFormData:] class used for 'upgrading' a [MimeMultipart] by
parsing it as a 'multipart/form-data' part. The following code shows how
it can be used.

  HttpServer server = ...;
  server.listen((request) {
    String boundary = request.headers.contentType.parameters['boundary'];
    request
        .transform(new MimeMultipartTransformer(boundary))
        .map(HttpMultipartFormData.parse)
        .map((HttpMultipartFormData formData) {
          // form data object available here.
        });

[:HttpMultipartFormData:] is a Stream, serving either bytes or decoded
Strings. Use [isText] or [isBinary] to see what type of data is provided.

Representation of a header value in the form:

  [:value; parameter1=value1; parameter2=value2:]

[HeaderValue] can be used to conveniently build and parse header
values on this form.

To build an [:accepts:] header with the value

    text/plain; q=0.3, text/html

use code like this:

    HttpClientRequest request = ...;
    var v = new HeaderValue("text/plain", {"q": "0.3"});
    request.headers.add(HttpHeaders.ACCEPT, v);
    request.headers.add(HttpHeaders.ACCEPT, "text/html");

To parse the header values use the [:parse:] static method.

    HttpRequest request = ...;
    List<String> values = request.headers[HttpHeaders.ACCEPT];
    values.forEach((value) {
      HeaderValue v = HeaderValue.parse(value);
      // Use v.value and v.parameters
    });

An instance of [HeaderValue] is immutable.
